import React, {Component} from "react";
import "../index";
import Home from "./home";
import {render} from "react-dom";
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Account from "./Accountpage";
import Login from "./Loginpage";
import Cart from "./Addcart";
import { CartProvider } from "react-use-cart";
import  ReactDOM  from "react-dom";
import Card from "./creditCard";
import PeopleIcon from '@mui/icons-material/People';
import ClassIcon from '@mui/icons-material/Class';
import CategoryIcon from '@mui/icons-material/Category';
import DiscountIcon from '@mui/icons-material/Discount';
import {Admin, Resource, ListGuesser} from 'react-admin';
import jsonServerProvider from 'ra-data-json-server';
import Dashboard from './dashboard';
import { createTheme, ThemeProvider } from "@mui/material/styles"; 
import userList from './adminUsers';

const theme = {
  palette: {
      mode: 'light', // Switching the dark mode on is a single property value change.
  },
}
export default class App extends Component{
  render(){
  return (

        <Router>
            <Routes>
                <Route exact path='/' element={<Home />}></Route> 
                <Route exact path="/CreateAccount" element={<Account />}></Route>
                <Route exact path="/LoginAccount" element={<Login />}></Route>
                <Route exact path="/Cart" element={<Cart />}></Route>
                <Route exact path="/Card" element={<Card />}></Route>


            </Routes>
        </Router>,
        <Admin theme={theme} dashboard={Dashboard} dataProvider={jsonServerProvider('https://jsonplaceholder.typicode.com')} >
            <Resource name="Add Users" list={userList} icon={PeopleIcon}  />
            <Resource name="Add Categories & Items" list={ListGuesser} icon={CategoryIcon} />
            <Resource name="Add Restaurant Branches" list={ListGuesser} icon={ClassIcon} />
            <Resource name="Promotions & Discounts" list={ListGuesser} icon={DiscountIcon} />
        </Admin>

    );
  }
}

ReactDOM.render(

  <CartProvider>
    {<App />}
  </CartProvider>,
  document.getElementById("app")
)
